import React from 'react'
import { useSelector } from 'react-redux'

import Cart from './modules/Cart'
import Home from './pages/Home'

const App = () => {
  const { isVisibCart } = useSelector(state => state.cartVisib)

  return (
    <div className="wrapper">
      {isVisibCart && <Cart />}
      <Home />
    </div>
  )
}

export default App
